#include "source.c"

#include <stdio.h>

void readPriceTable(int prices[][2], int priceCount) {
	for (int i = 0; i < priceCount; ++ i) {
		scanf("%d", &prices[i][0]);
	}
	for (int i = 0; i < priceCount; ++ i) {
		scanf("%d", &prices[i][1]);
	}
}

void test(int prices[][2], int priceCount) {
	int rodLength;
	scanf("%d", &rodLength);
	printf("%d\n", getMaxCuttingPrice(prices, priceCount, rodLength));
}

int main() {
	int prices[6][2];
	readPriceTable(prices, 6);

	for (int i = 0; i < 10; ++ i) {
		test(prices, 6);
	}
}

int max(int a,int b) {return (a > b ? a : b);}
int getMaxCuttingPrice(int prices[][2],int priceCount,int len)
{
	if (len == 0) return 0;
	int q = -1;
	for (int i = 0; i < priceCount; ++ i)
	{
		q = max(q,prices[i][2] + getMaxCuttingPrice(prices,priceCount,len-i-1));
	}
	return q;
}
